import React from 'react';
import FacebookIcon from '@material-ui/icons/Facebook';
import InstagramIcon from '@material-ui/icons/Instagram';
import LinkedInIcon from '@material-ui/icons/LinkedIn';
import GitHubIcon from '@material-ui/icons/GitHub';

const Contact = () => {
    return (
    <>
<h1>This is Contact page..</h1>

<a href="https://www.facebook.com/profile.php?id=100011005447849" target="_blank"> <FacebookIcon/> </a>
  <a href="https://www.facebook.com/profile.php?id=100011005447849" target="_blank"> <InstagramIcon/></a>
  <a href="https://www.facebook.com/profile.php?id=100011005447849" target="_blank"> <LinkedInIcon/></a>
  <a href="https://www.facebook.com/profile.php?id=100011005447849" target="_blank"> <GitHubIcon/></a>
    </>
    );
}

export default Contact;
